{
  "$schema": "https://biomejs.dev/schemas/1.8.3/schema.json",
  "organizeImports": {
    "enabled": false
  },
  "linter": {
    "enabled": true,
    "ignore": ["**/*/generated-new.ts", "**/*/generated-v2.ts", ".tamagui"],

    "rules": {
      "correctness": {
        "useExhaustiveDependencies": "off",
        "noInnerDeclarations": "off",
        "noUnnecessaryContinue": "off",
        "noConstructorReturn": "off"
      },
      "suspicious": {
        "noImplicitAnyLet": "off",
        "noConfusingVoidType": "off",
        "noEmptyInterface": "off",
        "noExplicitAny": "off",
        "noArrayIndexKey": "off",
        "noDoubleEquals": "off",
        "noConsoleLog": "error",
        "noAssignInExpressions": "off",
        "noRedeclare": "off"
      },
      "style": {
        "noParameterAssign": "off",
        "noNonNullAssertion": "off",
        "noArguments": "off",
        "noUnusedTemplateLiteral": "off",
        "useDefaultParameterLast": "off",
        "useConst": "off",
        "useEnumInitializers": "off",
        "useTemplate": "off",
        "useSelfClosingElements": "off",
        "useImportType": "error"
      },
      "security": {
        "noDangerouslySetInnerHtml": "off",
        "noDangerouslySetInnerHtmlWithChildren": "off"
      },
      "performance": {
        "noDelete": "off",
        "noAccumulatingSpread": "off"
      },
      "complexity": {
        "noForEach": "off",
        "noBannedTypes": "off",
        "noUselessFragments": "off",
        "useLiteralKeys": "off",
        "useSimplifiedLogicExpression": "off",
        "useOptionalChain": "off"
      },
      "a11y": {
        "noSvgWithoutTitle": "off",
        "useMediaCaption": "off",
        "noHeaderScope": "off",
        "useAltText": "off",
        "useButtonType": "off"
      }
    }
  },
  "formatter": {
    "enabled": true,
    "formatWithErrors": false,
    "indentStyle": "space",
    "indentWidth": 2,
    "lineWidth": 100,
    "ignore": ["**/*/generated-new.ts", "**/*/generated-v2.ts", ".tamagui"]
  },
  "javascript": {
    "formatter": {
      "trailingCommas": "es5",
      "jsxQuoteStyle": "double",
      "semicolons": "asNeeded",
      "quoteStyle": "single"
    }
  }
}

{
  "files": [],
  "compilerOptions": {
    "typeRoots": ["node_modules/@types"],
    "skipDefaultLibCheck": true,
    "skipLibCheck": true,
    "noEmit": true
  },
  "references": [
    {
      "path": "packages/one"
    },
    {
      "path": "packages/create-vxrn"
    },
    {
      "path": "apps/chat"
    },
    {
      "path": "examples/one-recommended"
    },
    {
      "path": "examples/one-zero"
    },
    {
      "path": "examples/bare"
    }
  ]
}

{
  "$schema": "https://turbo.build/schema.json",
  "extends": ["//"],
  "tasks": {
    "build:js": {
      "cache": false
    },
    "build": {
      "dependsOn": ["^build"],
      "inputs": [
        "tsconfig.json",
        "biome.json",
        "package.json",
        "src/**/*",
        "tamagui-build.js",
        "externalNodePlugin.js"
      ],
      "outputs": [".next/**/*", "dist/**/*", "types/**/*"]
    },
    "check": {
      "cache": false,
      "outputs": []
    },
    "test": {
      "dependsOn": ["^build:js"],
      "outputs": []
    },
    "clean": {
      "outputs": ["dist/**/*"],
      "cache": false
    },
    "clean:build": {
      "outputs": [],
      "cache": false
    },
    "lint": {
      "outputs": []
    },
    "lint:fix": {
      "cache": false,
      "outputs": ["src/**/*"]
    }
  }
}
